import React from 'react';
import styled from 'styled-components';

const Col = styled.div`
  border: solid 1px #000;
  border-radius: 4px;
  height: 70px;
  width: 70px;
  margin: 1px;
  cursor: pointer;
  :hover {
    background-color: #ccc;
  }
`;

const Div = styled.div`
  background: url(${props => props.img}) center center/cover;
`;

const Square = ({ id, color, changeColor }) => {  
  console.log(color === "#6af");
  return (
    <Div img={ color === "#6af" ? 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fi1.wp.com%2Ffox-gg.com%2Fwp-content%2Fuploads%2F2018%2F07%2FX-Shape-PNG-High-Quality-Image.png%3Ffit%3D1200%252C1200%26ssl%3D1&f=1&nofb=1' : 
               color === "#f6c" ? 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fimg.pngio.com%2Fo-png-89-images-in-collection-page-2-png-o-2000_2000.png&f=1&nofb=1' :
               color === ""
   }>
      <Col id={ id }
          //  style={{ backgroundColor: color }} 
           onClick={ changeColor }

      >
      </Col>          
    </Div>
  );
}

export { Col, Square }
